  return (
    <div className="footer row">
      <div id="footer-text" className="col-lg-6 col-md-6 col-sm-12">
        <div className="">
          <p>Austin, Tx</p>
        </div>
        <div className="">
          <a href="tel:512-202-1802">512-202-1802</a>
        </div>
        <div className="">
          <p>justinhoffman193@gmail.com</p>
